import { Link, NavLink } from "react-router-dom";
import classes from './MainHeader.module.css'


const MainHeader =() =>{
    return(
        <header className={classes.header}>
            <nav>
                <ul>
                    <li>
                        <NavLink to="/welcome/">Welcome</NavLink>
                    </li>
                    <li>
                        <a href="/products/">Products</a>
                    </li>
                </ul>
            </nav>
        </header>
    )
}

export default MainHeader;
